import './App.css';
import Video from './component /video';
import data from './component /data/data';
import { useState } from 'react';


function App() {

 const [video, setVideo] = useState(data);

setVideo({firstName: 'rockybul'})
//  console.log(video)

//  const obj = {
//   userFirstName: 'Khabib',
//   userLastName: 'Nurmagomedov',
//   userAge: 34,
//   userGender: 'Male',
//   userCountry: 'Russia',
//  }
//  setVideo(obj)



  return (
    <div className='container'>
      {data.map(video => {
        return <Video
        id={video.id}
        key={video.id}
        title={video.title}
        channelName={video.channelName}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>
      })}
    </div>
  );
}

export default App;
